es refer to music fonts; the rest refer to text fonts. The fantasy style refers to decorative text such as found in older German-style printing. The font-style can be normal or italic. The font-size can be one of the CSS sizes (xx-small, x-small, small, medium, large, x-large, xx-large) or a numeric point size. The font-weight can be normal or bold. The default is application-dependent, but is a text font vs. a music font.','false'),(1850,1846,'XsElement','xs:attribute','font-family','false','','font-family','comma-separated-text','','','','','','','','','','','','','','','','','','','false'),(1851,1850,'XsMetadata','XsMetadata','name','false','font-family','','','','','','','','','','','','','','','','','','','','','false'),(1852,1850,'XsMetadata','XsMetadata','type','false','comma-separated-text','','','','','','','','','','','','','','','','','','','','','false'),(1853,1846,'XsElement','xs:attribute','font-style','false','','font-style','font-style','','','','','','','','','','','','','','','','','','','false'),(1854,1853,'XsMetadata','XsMetadata','name','false','font-style','','','','','','','','','','','','','','','','','','','','','false'),(1855,1853,'XsMetadata','XsMetadata','type','false','font-style','','','','','','','','','','','','','','','','','','','','','false'),(1856,1846,'XsElement','xs:attribute','font-size','false','','font-size','font-size','','','','','','','','','','','','','','','','','','','false'),(1857,1856,'XsMetadata','XsMetadata','name','false','font-size','','','','','','','','','','','','','','','','','','','','','false'),(1858,1856,'XsMetadata','XsMetadata','type','false','font-size','','','','','','','','','','','','','','','','','','','','','false'),(1859,1846,'XsElement','xs:attribute','font-weight','false','','font-weight','font-weight','','','','','','','','','','','','','','','','','','','false'),(1860,1859,'XsMetadata','XsMetadata','name','false','font-weight','','','','','','','','','','','','','','','','','','','','','false')