m or page as the preceding music. Normally this is the first music data within a measure. If used in multi-part music, they should be placed in the same positions within each part, or the results are undefined. The page-number attribute sets the number of a new page; it is ignored if new-page is not yes. Version 2.0 adds a blank-page attribute. This is a positive integer value that specifies the number of blank pages to insert before the current measure. It is ignored if new-page is not yes. These blank pages have no music, but may have text or images specified by the credit element. This is used to allow a combination of pages that are all text, or all text and images, together with pages of music. The staff-spacing attribute specifies spacing between multiple staves in tenths of staff space. This is deprecated as of Version 1.1; the staff-layout element should be used instead. If both are present, the staff-layout values take priority.','false'),(2139,2135,'XsElement','xs:attribute','staff-spacing','false','','staff-spacing','tenths','','','','','','','','','','','','','','','','','','','false'),(2140,2139,'XsMetadata','XsMetadata','name','false','staff-spacing','','','','','','','','','','','','','','','','','','','','','false'),(2141,2139,'XsMetadata','XsMetadata','type','false','tenths','','','','','','','','','','','','','','','','','','','','','false'),(2142,2135,'XsElement','xs:attribute','new-system','false','','new-system','yes-no','','','','','','','','','','','','','','','','','','','false'),(2143,2142,'XsMetadata','XsMetadata','name','false','new-system','','','','','','','','','','','','','','','','','','','','','false'),(2144,2142,'XsMetadata','XsMetadata','type','false','yes-no','','','','','','','','','','','','','','','','','','','','','false'),(2145,2135,'XsElement','xs:attribute','new-page','false','','new-page','yes-no','','','','','','','','','','','','','','','','','','','false'),(2146,2145,'XsMetadata','XsMetadata','name','false','new-page','