a link or bookmark. The position attribute specifies the position of this descendant element, where the first position is 1. The position attribute is ignored if the element attribute is not present. For instance, an element value of beam and a position value of 2 defines the link or bookmark to refer to the second beam descendant of the next sibling element that is not a link or bookmark. This is equivalent to an XPath test of [.//beam[2]] done in the context of the sibling element.','false'),(2158,2154,'XsElement','xs:attribute','element','false','','element','xs:NMTOKEN','','','','','','','','','','','','','','','','','','','false'),(2159,2158,'XsMetadata','XsMetadata','name','false','element','','','','','','','','','','','','','','','','','','','','','false'),(2160,2158,'XsMetadata','XsMetadata','type','false','xs:NMTOKEN','','','','','','','','','','','','','','','','','','','','','false'),(2161,2154,'XsElement','xs:attribute','position','false','','position','xs:positiveInteger','','','','','','','','','','','','','','','','','','','false'),(2162,2161,'XsMetadata','XsMetadata','name','false','position','','','','','','','','','','','','','','','','','','','','','false'),(2163,2161,'XsMetadata','XsMetadata','type','false','xs:positiveInteger','','','','','','','','','','','','','','','','','','','','','false'),(2164,0,'XsElement','xs:attributeGroup','link-attributes','true','','link-attributes','','','','','','','','','','','','','','','','','','','','false'),(2165,2164,'XsMetadata','XsMetadata','name','false','link-attributes','','','','','','','','','','','','','','','','','','','','','false'),(2166,2164,'XsElement','xs:annotation','','false','','','','','','','','','','','','','','','','','','','','','','false'),(2167,2166,'XsElement','xs:documentation','','false','','','','','','','','','','','','','','','','','','','','','The link-attributes group includes all the simple XLink attributes supported in the MusicXML format.','false'),(2168,2164,'XsElement','