attributes group is used by the measure element. Measures have a required number attribute (going from partwise to timewise, measures are grouped via the number). The implicit attribute is set to yes for measures where the measure number should never appear, such as pickup measures and the last half of mid-measure repeats. The value is no if not specified. The non-controlling attribute is intended for use in multimetric music like the Don Giovanni minuet. If set to yes, the left barline in this measure does not coincide with the left barline of measures in other parts. The value is no if not specified. In partwise files, the number attribute should be the same for measures in different parts that share the same left barline. While the number attribute is often numeric, it does not have to be. Non-numeric values are typically used together with the implicit or non-controlling attributes being set to yes. For a pickup measure, the number attribute is typically set to 0 and the implicit attribute is typically set to yes. Further details about measure numbering can be defined using the measure-numbering element. Measure width is specified in tenths. These are the global tenths specified in the scaling element, not local tenths as modified by the staff-size element. The width covers the entire measure from barline or system start to barline or system end.','false'),(2196,2192,'XsElement','xs:attribute','number','false','','number','xs:token','','','','','','required','','','','','','','','','','','','','false'),(2197,2196,'XsMetadata','XsMetadata','name','false','number','','','','','','','','','','','','','','','','','','','','','false'),(2198,2196,'XsMetadata','XsMetadata','type','false','xs:token','','','','','','','','','','','','','','','','','','','','','false'),(2199,2196,'XsMetadata','XsMetadata','use','false','required','','','','','','','','','','','','','','','','','','','','','false'),(2200,2192,'XsElement','xs:attribute','implicit','false','','implicit','yes