ys piano), we use the actual letters as the names of these dynamic elements. The other-dynamics element allows other dynamic marks that are not covered here, but many of those should perhaps be included in a more general musical direction element. Dynamics elements may also be combined to create marks not covered by a single element, such as sfmp. These letter dynamic symbols are separated from crescendo, decrescendo, and wedge indications. Dynamic representation is inconsistent in scores. Many things are assumed by the composer and left out, such as returns to original dynamics. Systematic representations are quite complex: for example, Humdrum has at least 3 representation formats related to dynamics. The MusicXML format captures what is in the score, but does not try to be optimal for analysis or synthesis of dynamics.','false'),(2240,2236,'XsElement','xs:choice','','false','','','','','','0','','unbounded','','','','','','','','','','','','','','false'),(2241,2240,'XsMetadata','XsMetadata','minOccurs','false','0','','','','','','','','','','','','','','','','','','','','','false'),(2242,2240,'XsMetadata','XsMetadata','maxOccurs','false','unbounded','','','','','','','','','','','','','','','','','','','','','false'),(2243,2240,'XsElement','xs:element','p','false','','p','empty','','','','','','','','','','','','','','','','','','','false'),(2244,2243,'XsMetadata','XsMetadata','name','false','p','','','','','','','','','','','','','','','','','','','','','false'),(2245,2243,'XsMetadata','XsMetadata','type','false','empty','','','','','','','','','','','','','','','','','','','','','false'),(2246,2240,'XsElement','xs:element','pp','false','','pp','empty','','','','','','','','','','','','','','','','','','','false'),(2247,2246,'XsMetadata','XsMetadata','name','false','pp','','','','','','','','','','','','','','','','','','','','','false'),(2248,2246,'XsMetadata','XsMetadata','type','false','empty','','','','','','','','','','','','','','','','','','','','','false