,'','','','','','','false'),(3067,3066,'XsElement','xs:documentation','','false','','','','','','','','','','','','','','','','','','','','','The ending type represents multiple (e.g. first and second) endings. Typically, the start type is associated with the left barline of the first measure in an ending. The stop and discontinue types are associated with the right barline of the last measure in an ending. Stop is used when the ending mark concludes with a downward jog, as is typical for first endings. Discontinue is used when there is no downward jog, as is typical for second endings that do not conclude a piece. The length of the jog can be specified using the end-length attribute. The text-x and text-y attributes are offsets that specify where the baseline of the start of the ending text appears, relative to the start of the ending line. The number attribute reflects the numeric values of what is under the ending line. Single endings such as 1 or comma-separated multiple endings such as 1,2 may be used. The ending element text is used when the text displayed in the ending is different than what appears in the number attribute. The print-object element is used to indicate when an ending is present but not printed, as is often the case for many parts in a full score.','false'),(3068,3064,'XsElement','xs:simpleContent','','false','','','','','','','','','','','','','','','','','','','','','','false'),(3069,3068,'XsElement','xs:extension','','false','','','','','','','xs:string','','','','','','','','','','','','','','','false'),(3070,3069,'XsMetadata','XsMetadata','base','false','xs:string','','','','','','','','','','','','','','','','','','','','','false'),(3071,3069,'XsElement','xs:attribute','number','false','','number','ending-number','','','','','','required','','','','','','','','','','','','','false'),(3072,3071,'XsMetadata','XsMetadata','name','false','number','','','','','','','','','','','','','','','','','','','','','false'),(3073,3071,'XsMetadata','XsM