ber indicating which inversion is used: 0 for root position, 1 for first inversion, etc.','false'),(3570,3566,'XsElement','xs:simpleContent','','false','','','','','','','','','','','','','','','','','','','','','','false'),(3571,3570,'XsElement','xs:extension','','false','','','','','','','xs:nonNegativeInteger','','','','','','','','','','','','','','','false'),(3572,3571,'XsMetadata','XsMetadata','base','false','xs:nonNegativeInteger','','','','','','','','','','','','','','','','','','','','','false'),(3573,3571,'XsElement','xs:attributeGroup','','false','','','','','print-style','','','','','','','','','','','','','','','','','false'),(3574,3573,'XsMetadata','XsMetadata','ref','false','print-style','','','','','','','','','','','','','','','','','','','','','false'),(3575,0,'XsElement','xs:complexType','kind','true','','kind','','','','','','','','','','','','','','','','','','','','false'),(3576,3575,'XsMetadata','XsMetadata','name','false','kind','','','','','','','','','','','','','','','','','','','','','false'),(3577,3575,'XsElement','xs:annotation','','false','','','','','','','','','','','','','','','','','','','','','','false'),(3578,3577,'XsElement','xs:documentation','','false','','','','','','','','','','','','','','','','','','','','','Kind indicates the type of chord. Degree elements can then add, subtract, or alter from these starting points The attributes are used to indicate the formatting of the symbol. Since the kind element is the constant in all the harmony-chord groups that can make up a polychord, many formatting attributes are here. The use-symbols attribute is yes if the kind should be represented when possible with harmony symbols rather than letters and numbers. These symbols include: major: a triangle, like Unicode 25B3 minor: -, like Unicode 002D augmented: +, like Unicode 002B diminished: , like Unicode 00B0 half-diminished: , like Unicode 00F8 For the major-minor kind, only the minor symbol is used when use-symbols is yes. The major symbol is set using the symbol attribute in the degree-value element. The corresponding degree-alter value will usually be 0 in this case. The text attribute describes how the kind should be spelled in a score. If use-symbols is yes, the value of the text attribute follows the symbol. The stack-degrees attribute is yes if the degree elements should be stacked above each other. The parentheses-degrees attribute is yes if all the degrees should be in parentheses. The bracket-degrees attribute is yes if all the degrees should be in a bracket. If not specified, these values are implementation-specific. The alignment attributes are for the entire harmony-chord group of which this kind element is a part.','false'),(3579,3575,'XsElement','xs:simpleContent','','false','','','','','','','','','','','','','','','','','','','','','','false'),(3580,3579,'XsElement','xs:extension','','false','','','','','','','kind-value','','','','','','','','','','','','','','','false'),(3581,3580,'XsMetadata','XsMetadata','base','false','kind-value','','','','','','','','','','','','','','','','','','','','','false'),(3582,3580,'XsElement','xs:attribute','use-symbols','false','','use-symbols','yes-no','','','','','','','','','','','','','','','','','','','false'),(3583,3582,'XsMetadata','XsMetadata','name','false','use-symbols','','','','','','','','','','','','','','','','','','','','','false'),(3584,3582,'XsMetadata','XsMetadata','type','false','yes-no','','','','','','','','','','','','','','','','','','','','','false'),(3585,3580,'XsElement','xs:attribute','text','false','','text','xs:token','','','','','','','','','','','','','','','','','','','false'),(3586,3585,'XsMetadata','XsMetadata','name','false','text','','','','','','','','','','','','','','','','','','','','','false'),(3587,3585,'XsMetadata','XsMetadata','type','false','xs:token','','','','','','','','','','','','','','','','','','','','','false'),(3588,3580,'XsElement','xs:attribute','stack-degrees','false','','stack-degrees