,'','','','','','','','','','','','','','','','','The normal-dot element is used to specify dotted normal tuplet types.','false'),(5542,0,'XsElement','xs:complexType','tremolo','true','','tremolo','','','','','','','','','','','','','','','','','','','','false'),(5543,5542,'XsMetadata','XsMetadata','name','false','tremolo','','','','','','','','','','','','','','','','','','','','','false'),(5544,5542,'XsElement','xs:annotation','','false','','','','','','','','','','','','','','','','','','','','','','false'),(5545,5544,'XsElement','xs:documentation','','false','','','','','','','','','','','','','','','','','','','','','The tremolo ornament can be used to indicate either single-note or double-note tremolos. Single-note tremolos use the single type, while double-note tremolos use the start and stop types. The default is single for compatibility with Version 1.1. The text of the element indicates the number of tremolo marks and is an integer from 0 to 8. Note that the number of attached beams is not included in this value, but is represented separately using the beam element. When using double-note tremolos, the duration of each note in the tremolo should correspond to half of the notated type value. A time-modification element should also be added with an actual-notes value of 2 and a normal-notes value of 1. If used within a tuplet, this 2/1 ratio should be multiplied by the existing tuplet ratio. Using repeater beams for indicating tremolos is deprecated as of MusicXML 3.0.','false'),(5546,5542,'XsElement','xs:simpleContent','','false','','','','','','','','','','','','','','','','','','','','','','false'),(5547,5546,'XsElement','xs:extension','','false','','','','','','','tremolo-marks','','','','','','','','','','','','','','','false'),(5548,5547,'XsMetadata','XsMetadata','base','false','tremolo-marks','','','','','','','','','','','','','','','','','','','','','false'),(5549,5547,'XsElement','xs:attribute','type','false','','type','start-stop-single','','','',