ion element shows how the cumulative, sounding effect of tuplets and double-note tremolos compare to the written note type, the tuplet element describes how this is displayed. The tuplet element also provides more detailed representation information than the time-modification element, and is needed to represent nested tuplets and other complex tuplets accurately. The show-number attribute is used to display either the number of actual notes, the number of both actual and normal notes, or neither. It is actual by default. The show-type attribute is used to display either the actual type, both the actual and normal types, or neither. It is none by default.','false'),(5561,5557,'XsElement','xs:sequence','','false','','','','','','','','','','','','','','','','','','','','','','false'),(5562,5561,'XsElement','xs:element','tuplet-actual','false','','tuplet-actual','tuplet-portion','','','0','','','','','','','','','','','','','','','','false'),(5563,5562,'XsMetadata','XsMetadata','name','false','tuplet-actual','','','','','','','','','','','','','','','','','','','','','false'),(5564,5562,'XsMetadata','XsMetadata','type','false','tuplet-portion','','','','','','','','','','','','','','','','','','','','','false'),(5565,5562,'XsMetadata','XsMetadata','minOccurs','false','0','','','','','','','','','','','','','','','','','','','','','false'),(5566,5562,'XsElement','xs:annotation','','false','','','','','','','','','','','','','','','','','','','','','','false'),(5567,5566,'XsElement','xs:documentation','','false','','','','','','','','','','','','','','','','','','','','','The tuplet-actual element provide optional full control over how the actual part of the tuplet is displayed, including number and note type (with dots). If any of these elements are absent, their values are based on the time-modification element.','false'),(5568,5561,'XsElement','xs:element','tuplet-normal','false','','tuplet-normal','tuplet-portion','','','0','','','','','','','','','','','','','','','